import { Table } from "reactstrap";
import {getEventList} from "../lib/utility";
export default ({allEventData}) => {  
  return (
    <div>
      <Table striped>
        <thead>
            <tr>
            <th>Purpose of Event</th>
            <th>Date and Time of Event</th>
            <th>details</th>
            </tr>
        </thead>
        <tbody>
            {allEventData.map((res)=>{
                return(
                <tr>
                    <th>res.purpose</th>
                    <th>res.conducted_on</th>
                    <th>res.details</th>
                </tr>
                );
            })
            }
        </tbody>
        </Table>
    </div>
  );
};


export async function getStaticProps() {
    const allEventData = getEventList();
    return {
      props: {
        allEventData
      }
    }
  }
